import React from 'react';
import { NavLink } from 'react-router-dom';
import  '../container/assignmentContent.css'
function AssignmentContent() {
  return (
    <div className='assignment_page'>
        <h1>Assignment Zone</h1>
        <div className='problems'>
              <div className='assignment_problem'>
                  <nav value='/'><NavLink to="/cya">Complete Your Assigments</NavLink></nav>
              </div>
              <div className='programming_problem'>
              <nav value='/'><NavLink to="/cya">Complete Your lAb</NavLink></nav>
              </div>
        </div>
    </div>
  )
}

export default AssignmentContent
